    //       {/* <Header/>
    //         <First/>
    //     <DemoAnkit/> 
    //     <Footer/> */}
    //   {/* <Text2Speech/> */}
    //   {/* <Demo/> */}
     
    // {/* <Createnote/>
    // <Note/> */}
    //   {/* <Footerdemo/> */}
    //   </div>
    );
  }
}

export default App;
